window.bookSummaryJSON = "<p><b>Reunited: Chaos returns from her year-long exile and finds her home in ruins. </b></p> <p>The human-led Alliance has conquered over half the Dominion's lands and is set to overrun the demons' final bastion. But finally reunited with her lovers and accompanied by her new allies, the crown princess is ready to reclaim her nation.</p> <p>Asoko, thawed from her prison of Eternal Ice, aids the dwarves in their war against the menace from below. Before the other half of Chaos can return to the Dominion, she and her companions will come face to face with a new destiny in the faraway land of fire and ice.</p> <p><i>The Return of the Queen</i> is the seventh volume of the Demon Princess Magical Chaos Saga. It sees Chaos and her allies enter an all-out war against the nations controlled by the false gods. In this epic struggle for survival, the Crawling Chaos will have to overcome her greatest challenge yet.</p>"; 
